import React from "react";
export type Content = {
    catalogWidth: number;
  setWidth: (num: number) => void;
};
export const ContentContext = React.createContext<Content>({
  width: 1500,
  setWidth: () => {},
});
export const Context = React.createContext(ContentContext);
